import React from 'react';
import { Breadcrumbs, Link, Box, Typography, Grid, Paper, Avatar } from '@mui/material';
import { useLocation, Link as RouterLink } from 'react-router-dom';

const ExcessInventoryItems = () => {
  const items = [
    { name: 'Tin', qty: 25548 },
    { name: 'Env', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 }, 
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
  ];

  const location = useLocation();
  const item = location.state?.item;

  return (
    <Box sx={{ minHeight: '100vh', bgcolor: 'background.default', p: 2, pt: 1 }}>
      {/* Breadcrumbs */}
      <Breadcrumbs aria-label="breadcrumb" sx={{ mb: 2 }}>
        <Link underline="hover" color="inherit" component={RouterLink} to="/">
          Item Types
        </Link>
        <Typography color="text.primary">Excess Inventory Items</Typography>
      </Breadcrumbs>

      {/* Header */}
      <Paper sx={{ py: 2, mb: 1, bgcolor: 'background.bg1', display: 'flex', alignItems: 'center', pl: 2 }}>
        <Typography variant="h4" fontWeight="bold" sx={{ transition: 'all 1s ease-in-out' }}>
          Aging Packing Materials Stock Management System
        </Typography>
      </Paper>

      {/* Page Content */}
      \
      <Typography variant="h4">Excess Inventory Items</Typography>
      {item && (
        <Box mt={2}>
          <Typography variant="h6">Selected Item: {item.name}</Typography>
          <Typography>Quantity: {item.qty}</Typography>
        </Box>
      )}
    </Box>
  );
};

export default ExcessInventoryItems;
